import React from "react";
function App(props){
    return(
        <div>
            <div><img src={props.imgsrc}/></div>
            <div>
                <span>{props.title}</span>
                <h3>{props.sname}</h3>
                <a href={props.link}>
                    <button>Watch Now</button>
                </a>
            </div>
        </div>
    );
}
export default App;
